import "./App.css";
import MovieCrad from "./components/MovieCrad";
import movieList from "./components/MovieList";

function renderMe(props) {
  return <MovieCrad title={props.title} description={props.description} />;
}

function App() {
  return (
    <div className="App">
      <MovieCrad
        title={movieList[0].title}
        description={movieList[0].description}
      />
    </div>
  );
}

export default App;
